import React from "react";
import { makeStyles, Grid, Paper } from "@material-ui/core";
import { grey } from "@material-ui/core/colors";

const useStyles = makeStyles(theme => ({
  container: {
    flexGrow: 1,
    height: "660px",
    textAlign: "center",
    background: grey[400]
  },
  text: {
    color: "white",
    padding: "0 auto",
    margin: "0"
  }
}));

const BodyOrderChoiceList = () => {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <Grid container>
        <Grid item xs={12} style={{ background: "grey", height: 20 }}></Grid>
        <Grid item xs={12}>
          <Paper className={classes.paper}>1번</Paper>
        </Grid>
        <Grid item xs={12}>
          <Paper className={classes.paper}>2번</Paper>
        </Grid>
      </Grid>
    </div>
  );
};

export default BodyOrderChoiceList;
